import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import MeasureForwardGrowth from "./pages/MeasureForwardGrowth";
import MeasureImprovement from "./pages/MeasureImprovement";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="App">
        <Link to="/forward-growth">
          <button className="measure-button">Measure Forward Growth</button>
        </Link>
        <Link to="/improvement">
          <button className="improvement-button">Measure Improvement</button>
        </Link>

        <Routes>
          <Route path="/forward-growth">
            <MeasureForwardGrowth />
          </Route>
          <Route path="/improvement">
            <MeasureImprovement />
          </Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
